import React from 'react';
import Auth from '../auth';
import Input from '../../input';
const login=(props)=>{



return( 
<Auth>
        <h2>Login</h2>
        <form>
        <Input 
        id = 'name'
        onChange={(event)=>this.inputChangedHandler(event,'title')} 
        elementtype='text' 
        label='Name'/>

    <Input 
        id = 'email'
        onChange={(event)=>this.inputChangedHandler(event,'title')} 
        elementtype='email' 
        label='Email'/>
 
    <Input 
        id = 'password'
        onChange={(event)=>this.inputChangedHandler(event,'title')} 
        elementtype='password' 
        label='Password'/>
        
        
        </form>
    </Auth>
)

}


export default login
